import React from 'react'
import './formstyle.css'

function Formcomponent() {
    function check(){
        var get=document.getElementById("password");
        if(get.value.trim().length<5){
            alert("Password is short must be greater than 5");
            return false;
        }
    }
    return (
        <div class="container-fluid">
            <div class="row">
            <div class="col-md-4 col-sm-4 col-xs-12"></div>
                <div class="offset-md-4 col-md-4">
                <center><div className="bg"></div></center>
                <center><h1>Log in to instatweets</h1></center>
                <hr></hr>
                <form action="">
                <div class="form-group">
                    <label for="exampleInputEmail1">phone,email,or username</label>
                    <input type="text"  class="form-control"id="exampleInputEmail1"  required></input>
                    <hr></hr>
                </div>
                <div class="form-group">
                    <label for="exampleInputPassword1">Password</label>
                    <input type="password" class="form-control" id="password" required></input>
                    <hr></hr>   
                </div>
                <button onClick={check} type="submit" class="btn btn-primary btn-block" className="change">Log in</button>
                <center><a href="#">Forgot password?.</a></center>
               {/* <center><a href="#">Sign up for instatweets?.</a></center>  */}
                </form>
                </div>
                <div class="col-md-4 col-sm-4 col-xs-12"></div>
            </div>

        </div>
    )
}

export default Formcomponent
